import React, { Component } from 'react'
import Data from '../Data/cars.json';


export class Audi extends Component {

    state = {
        carsAudi: []
    }



    render() {
        return (
            <div>
                <div className="container mt-5 pt-5">
                    <div className="row">
                        {Data.map(cars => {
                            return (
                                <div key={cars.Audi[i++]}>
                                    <img className="col-lg-3 img-show-side" src={cars.Audi[i++]} alt={cars.Audi[i++]} />
                                    <div className="col-lg-9">{cars.Audi[i++]}</div>
                                </div>
                            )
                        })}
                    </div>
                </div>
            </div>
        )
    }
}

export default Audi
